import React, { useState } from 'react';
import axios from 'axios';

//'https://jsonplaceholder.typicode.com/todos/1',
const App = () => {
  const [data, setData] = useState(null);
  const onClick = async () => {
    try {
      var xhr = new XMLHttpRequest();
      var url =
        'http://openapi.data.go.kr/openapi/service/rest/Covid19/getCovid19InfStateJson'; /*URL*/
      var queryParams =
        '?' +
        encodeURIComponent(
          'MCOPjJc8P6GG3tLEXY0HTl%2FOzFqj%2BiStMV8aQ4FnL25TCt20be%2BpYIH%2FPQNlfUQyUOtMSxOgSoSA%2BS245I9n%2Fg%3D%3D',
        ) +
        '=' +
        'MCOPjJc8P6GG3tLEXY0HTl%2FOzFqj%2BiStMV8aQ4FnL25TCt20be%2BpYIH%2FPQNlfUQyUOtMSxOgSoSA%2BS245I9n%2Fg%3D%3D'; /*Service Key*/
      queryParams +=
        '&' +
        encodeURIComponent(
          'MCOPjJc8P6GG3tLEXY0HTl%2FOzFqj%2BiStMV8aQ4FnL25TCt20be%2BpYIH%2FPQNlfUQyUOtMSxOgSoSA%2BS245I9n%2Fg%3D%3D',
        ) +
        '=' +
        encodeURIComponent('-'); /**/
      queryParams +=
        '&' + encodeURIComponent('pageNo') + '=' + encodeURIComponent('1'); /**/
      queryParams +=
        '&' +
        encodeURIComponent('numOfRows') +
        '=' +
        encodeURIComponent('10'); /**/
      queryParams +=
        '&' +
        encodeURIComponent('startCreateDt') +
        '=' +
        encodeURIComponent('20200310'); /**/
      queryParams +=
        '&' +
        encodeURIComponent('endCreateDt') +
        '=' +
        encodeURIComponent('20200315'); /**/
      xhr.open('GET', url + queryParams);
      xhr.onreadystatechange = function () {
        if (this.readyState === 4) {
          alert(
            'Status: ' +
              this.status +
              'nHeaders: ' +
              JSON.stringify(this.getAllResponseHeaders()) +
              'nBody: ' +
              this.responseText,
          );
        }
      };

      xhr.send('');
      const response = await axios.get(
        decodeURIComponent(
          'http://openapi.data.go.kr/openapi/service/rest/Covid19/getCovid19InfStateJson?serviceKey=MCOPjJc8P6GG3tLEXY0HTl%2FOzFqj%2BiStMV8aQ4FnL25TCt20be%2BpYIH%2FPQNlfUQyUOtMSxOgSoSA%2BS245I9n%2Fg%3D%3D&pageNo=1&numOfRows=10&startCreateDt=20200310&endCreateDt=20200315&_type=json',
        ),
      );
      setData(queryParams);
      console.log(data);
    } catch (e) {
      console.log(e);
    }
  };
  return (
    <div>
      <div>
        <button onClick={onClick}>불러오기</button>
      </div>
      {data && (
        <textarea
          rows={1000}
          value={JSON.stringify(data, null, 2)}
          readOnly={true}
        />
      )}
    </div>
  );
};

export default App;
